Kopi Ulee Kareng adalah 100% kopi Arabica asli yang berasal dari dataran tinggi Aceh. Kopi merah segar yang dipetik petani, langsung diproses melalui penngeringan matahari, digonseng, digiling, lalu dikemas. Hasilnya, diperoleh kopi bubuk asli Arabica yang sangat istimewa dan cocok sebagai kopi saring.

